import{_ as e,o,c as a,R as t}from"./chunks/framework.d45ee533.js";const x=JSON.parse('{"title":"http 状态码","description":"","frontmatter":{},"headers":[],"relativePath":"knowledge/network/http-code.md"}'),l={name:"knowledge/network/http-code.md"},i=t('<h1 id="http-状态码" tabindex="-1">http 状态码 <a class="header-anchor" href="#http-状态码" aria-label="Permalink to &quot;http 状态码&quot;">​</a></h1><h2 id="_1xx-消息状态码" tabindex="-1">1XX：消息状态码 <a class="header-anchor" href="#_1xx-消息状态码" aria-label="Permalink to &quot;1XX：消息状态码&quot;">​</a></h2><ul><li><p><code>100 Continue</code>：继续。客户端应继续其请求。</p></li><li><p><code>101 Switching Protocols</code>：切换协议。服务器根据客户端的请求切换协议。只能切换到更高级的协议，例如，切换到 HTTP 的新版本协议。</p></li></ul><h2 id="_2xx-成功状态码" tabindex="-1">2XX：成功状态码 <a class="header-anchor" href="#_2xx-成功状态码" aria-label="Permalink to &quot;2XX：成功状态码&quot;">​</a></h2><ul><li><code>200 OK</code>：请求成功。一般用于 GET 与 POST 请求。</li><li><code>204 No Content</code>：服务器成功执行了请求，但是没有返回信息，常见于 OPTIONS 请求</li></ul><h2 id="_3xx-重定向状态码" tabindex="-1">3XX：重定向状态码 <a class="header-anchor" href="#_3xx-重定向状态码" aria-label="Permalink to &quot;3XX：重定向状态码&quot;">​</a></h2><ul><li><p><code>301 Moved Permanently</code>：永久移动。请求的资源已被永久的移动到新 URI，返回信息会包括新的 URI，浏览器会自动定向到新 URI。今后任何新的请求都应使用新的 URI 代替。301 会默认缓存重定向的地址，后续不会在请求服务器，这样可以减少请求次数。</p></li><li><p><code>302 Found</code>：临时移动，与 301 类似。但资源只是临时被移动。客户端应继续使用原有 URI。</p></li><li><p><code>304 Not Modified</code>：资源未修改，客户端应从缓存中获取数据。</p></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>301 适合地址永久转移，比如域名变更 302 适合临时转移，比如首页临时跳转到活动页</p></div><h2 id="_4xx-客户端错误状态码" tabindex="-1">4XX：客户端错误状态码 <a class="header-anchor" href="#_4xx-客户端错误状态码" aria-label="Permalink to &quot;4XX：客户端错误状态码&quot;">​</a></h2><ul><li><p><code>400 Bad Request</code>：客户端请求的语法错误，服务器无法理解。</p></li><li><p><code>401 Unauthorized</code>：请求要求用户的身份认证。</p></li><li><p><code>403 Forbidden</code>：服务器理解请求客户端的请求，但是拒绝执行此请求。(防盗链、同一 IP 多次请求，收到服务器屏蔽等)</p></li><li><p><code>404 Not Found</code>：服务器无法根据客户端的请求找到资源（网页）。通过此代码，网站设计人员可设置&quot;您所请求的资源无法找到&quot;的个性页面。</p></li><li><p><code>405 Method Not Allowed</code>：客户端请求中的方法被禁止。</p></li><li><p><code>409 Conflict</code>：示请求与服务器端目标资源的当前状态相冲突，冲突最有可能发生在对 PUT 请求的响应中。例如，当上传文件的版本比服务器上已存在的要旧，从而导致版本冲突的时候，那么就有可能收到状态码为 409 的响应。</p></li><li><p><code>410 Gone</code>：说明请求的目标资源在原服务器上不存在了，并且是永久性的丢失。如果不清楚是否为永久或临时的丢失，应该使用 404</p></li><li><p><code>413 Payload Too Large</code>：请求体过大 服务器无法处理</p></li></ul><h2 id="_5xx-服务端错误状态码" tabindex="-1">5XX：服务端错误状态码 <a class="header-anchor" href="#_5xx-服务端错误状态码" aria-label="Permalink to &quot;5XX：服务端错误状态码&quot;">​</a></h2><ul><li><p><code>500 Internal Server Error</code>：服务器内部出错。</p></li><li><p><code>502 Bad Gateway</code>：网关出错。</p></li></ul><h2 id="参考" tabindex="-1">参考 <a class="header-anchor" href="#参考" aria-label="Permalink to &quot;参考&quot;">​</a></h2><ul><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/HTTP/Status" target="_blank" rel="noreferrer">MDN</a></li><li><a href="https://juejin.cn/post/7104117388676694046" target="_blank" rel="noreferrer">掘金：常见的 HTTP 状态码有哪些？</a></li></ul>',14),d=[i];function r(c,n,p,h,s,u){return o(),a("div",null,d)}const P=e(l,[["render",r]]);export{x as __pageData,P as default};
